UILLO ALOJAMIENTO HP2070</td></tr><tr><td>78</td><td>419197-8</td><td>TAPA EMPUÑADURA HR1830</td></tr><tr><td>79</td><td>265999-8</td><td>TORNILLO M4X25</td></tr></tbody></table>', '<h1>Equipo básico</h1><table><tbody><tr><td>Tope de profundidad</td><td>415486-9</td></tr><tr><td>Maletín pvc</td><td>824695-3</td></tr></tbody></table><h1>Accesorios opcionales</h1><table><tbody><tr><td>Kit de mantenimiento HR1830</td><td>188389-7</td></tr><tr><td>Grasa para broca 100gr</td><td>194683-7</td></tr><tr><td>Adaptador SDS-PLUS con portabrocas automático</td><td>P-18150</td></tr></tbody></table>', 'manualesydespiecesurls [urlsmanualesydespieces=[http://www.icmsmakita.eu/cms/custom/es/user_manual/HR1830.pdf, http://www.makita.es/intcms/tools/objecten/print_partdrawing.asp?model=HR1830]]', 'HR1830', '<li>Portaherramientas con inserción SDS-PLUS y sistema de protección anti-polvo, ideal para trabajos en posición vertical. </li> \n<li>Martillo extremadamente ligero, para taladrar rápido y sin esfuerzo en hormigón, con brocas de hasta 18 mm de diámetro. Ideal para el instalador.</li> \n<li>2 posiciones de trabajo: rotación, rotación percusión. </li> \n<li>Empuñadura orientable 360º y tope de profundidad regulable</li> \n<li>Bloqueo de marcha en vacío.</li> \n<li>Guardacables más fuerte y flexible, para evitar desconexiones accidentales.</li> \n<li>Limitador de par: cuando la punta de la broca se bloquea accidentalmente, el limitador de par opera parando la rotación de la broca. </li> \n<li>Kit de mantenimiento recomendable cuando se realice el cambio de escobillas.</li> \n<li>Diseño ergonómico, con empuñadura antideslizante para un mayor control de la herramienta.</li> \n<li>Sistema de cambio de giro que genera más potencia al cambiar la posición de las escobillas respecto al inducido, alargando la vida de las escobillas 3 veces más de lo habitual.</li>', 'simboloslogos [urlsimboloslogos=[https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/Double insulation_m.jpg, h