tico</td><td>P-18150</td></tr></tbody></table>', 'manualesydespiecesurls [urlsmanualesydespieces=[http://www.icmsmakita.eu/cms/custom/es/user_manual/HR2300.pdf, http://www.makita.es/intcms/tools/objecten/print_partdrawing.asp?model=HR2300]]', 'HR2300', '<li>Diseño ergonómico, con empuñadura antideslizante y con elastómero para un mayor control de la herramienta.</li> \n<li>Nueva técnica de fabricación. Gracias a su sistema de percusión, reduce las vibraciones y baja el nivel de ruido.</li> \n<li>Mínima oscilación de la broca, con más guía, la broca se introduce en la herramienta hasta 44,5mm.</li> \n<li>Posibilidad de conectarle un aspirador a través del recolector de polvo opcional. </li> \n<li>Limitador de par: cuando la punta de la broca se bloquea accidentalmente, el limitador de par opera parando la rotación de la broca (Embrague de seguridad). </li> \n<li>Nueva situación del cambio de modo, más protegido frente a los golpes. </li> \n<li>Sistema eléctrico simplificado, más fácil de reparar. Sistema eléctrico simplificado, más fácil de reparar. </li> \n<li>Sistema de cambio de giro que permite cambiar la posición de las escobillas respecto del inducido, consiguiendo así más potencia y alargando la vida útil de las mismas 3 veces más de lo habitual. </li>', 'simboloslogos [urlsimboloslogos=[https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/Double insulation_m.jpg, https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/Variable speed_m.jpg, https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/Reversing model_m.jpg, https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/Toruku-rimiter_M.jpg, https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/SDS plus_m.jpg, https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/Cleaner_m.jpg, https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/Plastic case_m.jpg, ]]', 'urlfotos [urlfotos=[https://es.pdbmakita.com/images/1_Makita/101_machines/10104_JPG_Product/HR2300.jpg, https://es.pdbmakita.com/imagecheck.asp?path=/images/1_makita/105_action/10501_a/105013_JPG_hoog/&file=HR2300.jpg&width=529&height=591&thumb=1]]'),
