tr><td>Grasa para broca 100gr</td><td>194683-7</td></tr></tbody></table>', 'manualesydespiecesurls [urlsmanualesydespieces=[http://www.icmsmakita.eu/cms/custom/es/user_manual/HR2432.pdf, http://www.makita.es/intcms/tools/objecten/print_partdrawing.asp?model=HR2432]]', 'HR2432', '<li>Martillo ligero, para taladrar rápido y sin esfuerzo en hormigón, con brocas de hasta 24 mm de diámetro. Ideal para el instalador</li> \n<li>Portaherramientas con inserción SDS-PLUS y sistema de protección anti-polvo, ideal para trabajos en posición vertical</li> \n<li>3 posiciones del selector: rotación, rotación percusión y solo persusión</li> \n<li>Bloqueo de marcha en vacío</li> \n<li>Empuñadura orientable 360º y tope de profundidad regulable</li> \n<li>Guardacables más fuerte y flexible, para evitar desconexiones accidentales</li> \n<li>Limitador de par: cuando la punta de la broca se bloquea accidentalmente, el limitador de par opera parando la rotación de la broca</li> \n<li>Kit de mantenimiento recomendable cuando se realice el cambio de escobillas</li> \n<li>Diseño ergonómico, con empuñadura antideslizante para un mayor control de la herramienta</li> \n<li>Capaz de aspirar por sí mismo el polvo que suelta la broca. Mantiene el agujero siempre limpio</li> \n<li>Diseñado para trabajos que precisen mayor limpieza sin necesidad de utilizar un aspirador</li> \n<li>Hasta 40 posiciones de cinceleo sin necesidad de colocar un adaptador</li> \n<li>Saco recoge polvo, más grande y fácil de vaciar</li>', 'simboloslogos [urlsimboloslogos=[https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/Double insulation_m.jpg, https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/Variable speed_m.jpg, https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/Reversing model_m.jpg, https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/Toruku-rimiter_M.jpg, https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/SDS plus_m.jpg, https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/Cleaner_m.jpg, https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/Possible_use_as_chopping.jpg, https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/Plastic case_m.jpg, ]]', 'urlfotos [urlfotos=[https://es.pdbmakita.com/images/1_Makita/101_machines/10104_JPG_Product/HR2432.jpg, https://es.pdbmakita.com/imagecheck.asp?path=/images/1_makita/105_action/10501_a/105013_JPG_hoog/&file=HR2432.jpg&width=529&height=591&thumb=1]]');
