ante y con elastómero para mejor manejo y confort de la herramienta.</li> \n<li>Sistema neumático más resistente y fuerte.</li> \n<li> Empuñadura antideslizante y con elastómero para mejor manejo y confort de la herramienta.</li> \n<li>Sistema eléctrico simplifi cado, más fácil de reparar</li> \n<li>Nuevo motor S60 más grande, inducido más protegido frente al polvo, mediante barniz en zig-zag, con las delgas más grandes, así como las escobillas, mayor superfi cie de contacto.</li> \n<li>Bloqueo de marcha en vacío</li> \n<li>Empuñadura orientable 360º y tope de profundidad regulable</li> \n<li>Limitador de par: cuando la punta de la broca se bloquea accidentalmente, el limitador de par opera parando la rotación de la broca</li> \n<li>Kit de mantenimiento recomendable cuando se realice el cambio de escobillas</li> \n<li>Hasta 40 posiciones de cinceleo sin necesidad de colocar un adaptador</li>', 'simboloslogos [urlsimboloslogos=[https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/Double insulation_m.jpg, https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/Variable speed_m.jpg, https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/Reversing model_m.jpg, https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/Toruku-rimiter_M.jpg, https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/SDS plus_m.jpg, https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/Possible_use_as_chopping.jpg, https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/Cleaner_m.jpg, https://es.pdbmakita.com/images/1_Makita/104_symbols/10402_JPG_web/Plastic case_m.jpg, ]]', 'urlfotos [urlfotos=[https://es.pdbmakita.com/images/1_Makita/101_machines/10104_JPG_Product/HR2470.jpg, https://es.pdbmakita.com/imagecheck.asp?path=/images/1_makita/105_action/10501_a/105013_JPG_hoog/&file=HR2470.jpg&width=529&height=591&thumb=1]]'),
